s vídeos, ele deve reiniciar o objeto.\nsolicitação 7 (tablet) : Conversando com o Renato (Programador), não é possível eliminar a seta \"Play\" no vídeo que aparece no final de cada vídeo.','2014-07-29 18:15:36'),(280,765,7019,18,'o objeto foi fechado, mesmo com a indicação de baixa qualidade do vídeo.','2014-07-30 13:15:03'),(281,479,3402,18,'o editor aprovou mas eu solicitei o arquivo aberto para a produtora para podermos corrigir um crédio fora do padrão e o posicionamento de uma imagem.','2014-07-30 17:26:33'),(282,497,3404,18,'a RT aprovou mas eu notei alguns erros. solicitei o arquivo aberto ara correção.','2014-07-30 18:29:52'),(286,540,7050,18,'arquivo aberto solicitado. aguardar antes de iniciar produção','2014-07-31 17:24:58'),(287,3,7048,8,'Antes de carregar a primeira cena, a primeira coisa que aparece muito rapidamente é uma tela em branco com com a catraca (isso foi apontado no relatório que está na pasta da prova 7). Segundo o Renato, isto está acontecendo pois a imagem é pesada e por esse motivo demora mais pra carregar.','2014-08-01 15:18:17'),(290,554,7077,18,'pessoal, conversem entre si para poderem se ajudar nesta produção, ok? caso haja alguma dúvida, avisem.','2014-08-04 14:22:39'),(293,556,7105,9,'Lembrar na entrega da RT para avisar de tirar das imagens dos jornais logos e progapandas.','2014-08-07 15:00:46'),(294,469,7320,18,'já solicitei os arquivos abertos para a produtora. aguardando o retorno.','2014-08-13 13:37:10'),(301,560,7381,4,'teste','2014-08-22 12:26:53'),(303,583,7311,4,'teste','2014-09-01 16:09:24'),(305,994,7396,4,'dfadfafa\ndfafadf\nddddddddddd','2014-09-25 11:49:38');

