MA QUE ESTA DEVIDO A QUANTIDADE DE PALAVRAS QUE CADA PERGUNTA APRESENTA NO BOX.\n\n3.	Em todas as questões, centralizar o texto dos itens na caixa de texto (os espaços abaixo e acima do texto devem ser iguais).\n\n* NESSA SOLICITAÇÃO É QUASE IMPOSSÍVEL NÃO REPETIR AS CARTAS SURPRESA PARA O MESMO JOGADOR. A SELEÇÃO APARECE DE FORMA RANDÔMICA E ALGUM MOMENTO DO JOGO ELE APARECERÁ NOVAMENTE PARA O MESMO JOGADOR. COMO ESTA NÃO É UM ERRO MAIS UM PROCESSO NORMAL COMO SE ESTIVESSE JOGANDO UM BANCO IMOBILIÁRIO EM ALGUM MOMENTO AS MESMAS CARTAS APARECERAM NOVAMENTE PARA PODERMOS DAR CONTINUIDADE NO JOGO.\n\n4.	As mesmas cartas-surpresa aparecem mais de uma vez para o mesmo jogador.\n\n*A FRASE A BAIXO APARECE QUANDO TODAS AS PERGUNTAS TERMINAM SEGUIDO ATUALMENTE DO BOTÃO AVANÇAR. A SOLICITAÇÃO DE TROCAR O BOTÃO REINICIAR POR AVANÇAR NÃO SERÁ POSSÍVEL PQ MESMO TERMINANDO AS QUESTÕES EM SEGUIDA PRECISAMOS COMPARAR A SITUAÇÃO DE AMBOS OS JOGADORES. \n\nOps! O tempo acabou.\n<REINICIAR JOGO>\n\n\nNesse momento de oscilação do nosso querido servidor, ao checar, verifique se os arquivos não estão corrompendo para não prejudicar a checagem.\n\nObrigado!\n','2014-05-27 14:42:35'),(29879,9,6,3929,NULL,'2014-05-27 14:48:16'),(29880,30,7,3916,'segue v1:\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\historia\\ARhis7_un08an_trafico_escravos\\provas\\01','2014-05-27 15:01:11'),(29881,21,6,3854,'Valdeco, você pode aplicar as correções solicitadas e gerar v2 por favor?\n\nRelatório do editor:\nG:\\Depto\\01_PRODUCAO\\02_arariba\\04_material_3os\\geografia\\ARgeo7_un01vt_amazonia\\revisao\\v1\n\nO DVD está aqui comigo.\n\nObrigada!','2014-05-27 15:10:33'),(29882,22,6,3885,NULL,'2014-05-27 15:12:41'),(29883,30,6,3925,NULL,'2014-05-27 15:35:37'),(29884,8,6,3915,NULL,'2014-05-27 15:40:55'),(29885,30,6,3760,NULL,'2014-05-27 15:48:34'),(29886,8,7,3915,'Está ok','2014-05-27 15:50:20'),(29887,8,6,3917,NULL,'2014-05-27 15:50:40'),(29888,24,6,3895,NULL,'2014-05-27 16:02:26'),(29889,30,7,3