neste relatório foi algum problema na rede.\n\nMas por uma segunda garantia fiz as seguintes checagens:\n\nTestado no Chrome, Firefox, Tablet Galaxy TAB 2 e 3.\n\nNO NÍVEL 1, 2 e 3: Iniciei o nível e selecionei o primeiro dominó, ao clicar a primeira peça apareceu no seu lugar correto  e todas as peças da barra de escolha foram carregadas. Antes de encaixar a segunda peça correta arrastei todas as peças erradas e o pop up Ops apareceu(Botao X fechando corretamente), e cada peça errada voltou ao seu lugar de origem. Por fim encaixei a peça correta e ela me habilitou a proxima opçao a ser encaixada. Repeti esse mesmo processo também nas peças iniciais 2, 3, 4, 5, 6, 7, 8 e tudo funcionou normalmente.Problemas como peças duplicadas não ocorreram em nenhum momento.\n\nFEEDBACKS:\n\nTEMPO ACABOU: Testei em cada nivel, nenhum elemento apareceu sobrepondo e os botoes de reiniciar nivel estão funcionando normalmente. \n\nPARABENS DE CADA NIVEL: Em ambos aparecem a pontuação final e estrelas. Botões avançar e reiniciar nivel  estão funcionando normalmente.\n \nPARABENS FINAL: Estam aparecendo os resultados e estrelas de todos os niveis e calculando. Botões a reiniciar nivel e reiniciar jogo estão funcionando normalmente.\n\nFiz uma verificação bem minuciosa e caso ocorra algo anormal creio que pode ser alguma entidade do mal querendo me complicar ou bugs do servidor. Mais caso ocorra por favor me acione imediatamente e tente detalhar o máximo possível de como o erro surgiu passo a passo.\n\nTestei por ultimo na rede e  objeto funcionou normalmente em todos os niveis.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\matematica\\ARmat7_un14jg_domino\\provas\\01','2014-05-28 11:13:39'),(29943,22,6,3747,NULL,'2014-05-28 11:20:57'),(29944,24,6,3975,NULL,'2014-05-28 11:58:35'),(29945,24,7,3975,'Objeto liberado.','2014-05-28 11:58:48'),(29946,24,6,3996,NULL,'2014-05-28 12:19:11'),(29947,30,6,3998,NULL,'2014-05-28 13:40:57'),(29948,30,7,3998,'segue v1:\n\nG:\\Depto\\01_PROD