SA SOLICITAÇÃO NÃO É POSSÍVEL PORQUE DA FORMA QUE ESTA A ESTRUTURA DE CODIGO E FORMATOS DA IMAGEM NÃO PERMITE ESSA AÇÃO, IMPLICANDO EM REFAZER TODO O OBJETO. \n2 – É possível que as moedas que foram destacadas e irão virar nota deem uma piscada (todas juntas) antes de se transformarem na cédula de R$10?\n\nNO HTML NÃO É POSSÍVEL TRABALHAR COM OBJETOS VETORIAIS COMO NO FLASH, NESSE CASO A ÁREA DA GAVETA NÃO ESTA COM O FORMATO DE UM TRAPÉZIO E SIM DE UM QUADRADO. O HTML ENTENDE TUDO INDEPENDENTE DA IMAGEM OU FORMA APLICADA COMO RETÂNGULO. NESSE OBJETO AS MOEDAS E NOTAS ARRASTADAS ESTÃO ALINHADAS DENTRO DESSE RETÂNGULO SE EU AUMENTAR AS MOEDAS E NOTAS FICARAM FORA DA GAVETA. SUGIRO QUE SEMPRE AO ARRASTAR SOLTE O OBJETO NO CENTRO DA GAVETA. \n3 – Favor aumentar um pouco mais a área de aceitação das moedas, pois essa que está no exemplo abaixo não foi aceita e devolvida:\n\nQUALQUER DUVIDA SÓ ME PROCURAR QUE EXPLICO PESSOALMENTE.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\1_ano\\p_BUmat1_un06at_dinheiro\\provas\\06','2014-06-11 09:34:30'),(30763,9,7,5208,'Ajustado.\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\portugues\\navegar\\p_NVpor2_un08in_frase\\provas\\02','2014-06-11 09:35:38'),(30764,21,7,5048,'Pronto, relatório na rede.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\geografia\\ARgeo8_un06in_cuba\\provas\\01','2014-06-11 10:41:57'),(30765,21,6,5210,NULL,'2014-06-11 10:42:38'),(30766,21,7,5210,'Pronto, está ok, foram feitas as solicitações pedidas.','2014-06-11 10:51:21'),(30767,21,6,5215,NULL,'2014-06-11 10:51:36'),(30768,21,7,5215,'Pronto, está ok, foram feitas as solicitações pedidas.','2014-06-11 11:00:51'),(30769,21,6,5261,NULL,'2014-06-11 11:02:37'),(30770,8,7,5086,'Ajustes nas duas versões feitos:\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\matematica\\5_ano\\p_BUmat5_un08an_arte_indigena\\provas\\02','2014-06-11 11:02:38'),(30771,8,7,4977,'Correções feitas. V2 na rede:\nG:\\Depto\\01_PRODUCAO\\01_PNLD