tela de digitar o nome e na tela do alfabeto. Na tela de digitar o nome, é possível ver a mão aberta, mesmo que rapidamente, e esse é o certo. Na do alfabeto, mal dá para ver a mão aberta, o fade está “apagando” o início dos vídeos. Fica bem claro isso nas letras H, O, U, p.ex. O caso da letra Z é o mais grave, pois, na tela do alfabeto, fica cortado o início de demonstração da letra. Corrigir.\n\n\nAJUSTEI O CODIGO E ESSE ERRO NAO OCORREU NEM ANTES E NEM DEPOIS DO AJUSTE\n2. Atenção: no tablet, ainda está sendo aceito hífen. Tirar.\n\n\nCOLOQUEI UM LIMITADOR E ESTA FUNCIONANDO CORRETAMENTE.\n3. No tablet, continua sem limite de caracteres para digitação, pode-se digitar indefinidamente. Ele aceita e aplicar duas linhas na tela de clique. Aplicar limite de caracteres estabelecido (que é de 11).','2014-07-11 17:56:38'),(32597,22,6,7621,NULL,'2014-07-11 17:57:40'),(32598,8,7,7580,'v1 na pasta:\nG:\\Depto\\01_PRODUCAO\\02_arariba\\03_reaproveitados\\sociologia\\Soc8_un04an_teorias_politicas\\provas\\01','2014-07-11 17:58:29'),(32599,21,6,7627,NULL,'2014-07-11 18:01:04'),(32600,21,7,7627,'Está ok, foram feitas as solicitações pedidas. ','2014-07-11 18:01:37'),(32601,8,6,7622,NULL,'2014-07-11 18:05:27'),(32602,8,7,7622,'A alteração foi feita mas achei que tem muito espaço de tela preta apesar da música.\nO resto está ok','2014-07-11 18:06:15'),(32603,17,5,7629,NULL,'2014-07-11 18:28:12'),(32604,17,5,7630,NULL,'2014-07-11 18:30:01'),(32605,17,5,7631,NULL,'2014-07-11 18:33:52'),(32606,17,5,7632,NULL,'2014-07-11 18:35:42'),(32607,17,5,7633,NULL,'2014-07-11 18:37:59'),(32608,9,7,7607,'Prova 03\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\geografia\\ARgeo8_un05mi_estados_unidos\\provas\\03','2014-07-11 18:37:59'),(32609,22,7,7621,'Ajustes OK.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2016\\03_reaproveitados\\portugues\\buriti\\p_BUpor4_un09in_tempos_verbais\\provas\\03\\p_BUpor4_un09in_tempos_verbais_v3\n\n\nINCLUI O BOTÃO PAUSE PLAY E DESCONSIDEREI A BARRA DE PROGRESSÃO. IA FICAR 