REPETIÇÕES DO VÍDEO, CONFORME ESTÁ ATUALMENTE.\n10. As duas solicitações do relatório anterior não foram feitas. A primeira era de pausar a tela por 2 segundos, ao final da locução,. Antes do cross fade pra tela interativa. A outra era melhorar o looping no vídeo, pois o corte final da cena está muito brusco.  Corrgir conforme solicitado. Caso não seja possível, justificar o motivo.\n\n* POR TERMOS UM VÍDEO MENOR QUE A LOCUÇÃO A SOLICITAÇÃO DE 2 SEGUNDO FICOU UM POUCO NO LIMITE. CROSS FADE NÃO FOI APLICADO PQ OCORRE TELA PRETA NO FINAL DO VÍDEO, O PRÓPRIO HTML SE ENCARREGADA DA SAÍDA DO VÍDEO.\n12. Após o fim da locução, rodar o vídeo por mais 2 segundos. Depois, crossfade para a tela principal em que ele estava.  Isso já havia sido solicitado no relatório anterior.\n\n* OS BUGS APONTADOS FORAM CORRIGIDOS. FIZ DIVERSOS TESTES E OS BUGS NÃO OCORRERAM, CASO VENHA ACONTECER, POR FAVOR CHAME IMEDIATAMENTE E MARQUE O PASSO A PASSO QUE FEZ PARA OCORRER O BUG. \n04. Se ficarmos um tempo parados na home, o objeto vai sozinho para cena 1. Corrigir.\n08. Verificar bug: depois de um tempo na tela 2 (abaixo), o objeto voltou sozinho para a tela 1 (da praia), mas com as setas e funcionalidades misturadas. Isso já havia sido indicado no relatório anterior. Corrigir.\n09. O mesmo bug ocorre quando vamos da tela 2 (ao lado) para a 3 (do fundo do mar). Ele volta sozinho pra tela 2, com os botões misturados. Corrigir.\n','2014-07-24 11:08:27'),(33789,22,5,8021,NULL,'2014-07-24 11:08:27'),(33790,21,6,8018,NULL,'2014-07-24 11:08:51'),(33791,8,6,8015,NULL,'2014-07-24 11:10:56'),(33792,8,7,8015,'O corte final está muito seco.','2014-07-24 11:14:52'),(33793,8,5,8022,NULL,'2014-07-24 11:14:52'),(33794,21,6,8021,NULL,'2014-07-24 11:45:37'),(33795,17,5,8023,NULL,'2014-07-24 11:52:40'),(33796,17,5,8024,NULL,'2014-07-24 11:54:32'),(33797,22,6,8024,NULL,'2014-07-24 11:58:56'),(33798,17,5,8025,NULL,'2014-07-24 12:04:41'),(33799,22,7,8024,'Descaracterização OK.\n\nG:\\Depto\\01_PRODUCAO\\01_PNLD2