DO AS LINHAS DE CÓDIGOS. SE DURANTE ESSE CARREGAMENTO FICARMOS CLICANDO NA SETA ACORRE UM CONFLITO ENTRE OS COMANDOS. PARA CORRIGIR AS SETAS ESTÃO ENTRANDO DEPOIS QUE TUDO É CARREGADO EM TELAS.\n- Mais de uma vez, ao transitar da segunda tela (sobre o mar) para a primeira (areia), houve uma piscada de tela preta na transição. Isso não ocorreu da segunda para a terceira tela. Verificar.\n\n\n//RELATORIO RM\n\nAUMENTEI O TEMPO DE SAÍDA DO BG PARA QUE FICASSE MAIS DISCRETO.\n1) No tablet a cada mudança de tela a cena pisca. Verificar.\n\nNÃO CONSEGUI REPRODUZIR O ERRO. FOI DESCONSIDERADO.\n2. No Firefox, após o objeto ficar aberto por algum tempo sem mexer, surgiu esta tela.','2014-07-25 18:53:37'),(34135,22,5,8136,NULL,'2014-07-25 18:53:37'),(34136,9,6,8095,NULL,'2014-07-28 08:37:30'),(34137,17,5,8137,NULL,'2014-07-28 08:49:12'),(34138,18,5,8138,NULL,'2014-07-28 08:59:08'),(34140,18,5,8140,NULL,'2014-07-28 09:02:14'),(34141,18,5,8141,NULL,'2014-07-28 09:05:37'),(34142,18,5,8142,NULL,'2014-07-28 09:10:29'),(34143,18,5,8143,NULL,'2014-07-28 09:10:55'),(34144,18,5,8144,NULL,'2014-07-28 09:11:19'),(34145,18,5,8145,NULL,'2014-07-28 09:11:44'),(34146,18,5,8146,NULL,'2014-07-28 09:12:02'),(34147,18,5,8147,NULL,'2014-07-28 09:12:23'),(34148,18,5,8148,NULL,'2014-07-28 09:12:44'),(34149,18,NULL,NULL,NULL,'2014-07-28 09:13:05'),(34150,18,5,8149,NULL,'2014-07-28 09:13:36'),(34151,18,5,8150,NULL,'2014-07-28 09:14:01'),(34152,8,6,8137,NULL,'2014-07-28 09:18:10'),(34153,18,6,8142,NULL,'2014-07-28 09:18:33'),(34154,17,5,8151,NULL,'2014-07-28 09:18:57'),(34155,21,6,8140,NULL,'2014-07-28 09:19:02'),(34156,17,6,8136,NULL,'2014-07-28 09:22:02'),(34157,21,7,8140,'Pronto, consolidado.\n\nG:\\Depto\\01_PRODUCAO\\02_arariba\\02_novos\\matematica\\ARmat8_un07jg_balanca\\provas\n\nObs.: enviar anexos: \n[imagem/altas/Interface]\n[005-A- AM8-U07-BAL-M ], aos responsáveis pela produção. ','2014-07-28 09:48:54'),(34158,21,5,8152,NULL,'2014-07-28 09:48:54'),(34159,21,6,8138,NULL,'2014-07-28 09:49: