/*!50001 CREATE ALGORITHM=TEMPTABLE DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `moderna_ongoings` AS select `b`.`id` AS `id`,`b`.`object_id` AS `object_id`,`b`.`object_status_id` AS `object_status_id`,`b`.`userInfo_id` AS `userInfo_id`,`b`.`crono_date` AS `crono_date`,`b`.`topic` AS `topic`,`b`.`description` AS `description`,`b`.`created_at` AS `created_at`,`b`.`task_to` AS `task_to`,`b`.`ended` AS `ended`,`b`.`ordem` AS `ordem`,`b`.`tag_id` AS `tag_id`,`b`.`status_id` AS `status_id` from ((`moderna_objectstatus` `a` join `moderna_taskviews` `b` on((`a`.`object_status_id` = `b`.`object_status_id`))) left join `moderna_taskviews` `b2` on(((`a`.`object_status_id` = `b2`.`object_status_id`) and (`b`.`id` < `b2`.`id`)))) where (isnull(`b2`.`id`) and (`a`.`status_id` in ('2','4','9'))) group by `a`.`object_status_id` */;

